"height":420}}}]},{"cell_type":"markdown","source":"Looking at the charts, it looks like the passenger's sex, passenger class and passenger age are very good indicators to predict whether a passenger survives which just further validates our correlogram.\n\nNow before we build our logistic regression model, we have to impute the missing age & fare 1st. So let's explore and see what would be a good indicator to impute it.\n\n### 3.2.2 Age\n\nAge vs Pclass (in theory, older aged people should have more money and therefore a lower number Pclass)\n\nAge vs Sex (see whether there is a significant difference in age between sexes)\n\nThe other variables don't seem to be too correlated.","metadata":{}},{"cell_type":"code","source":"full %>% ggplot(aes(x=Pclass,y=Age)) + geom_boxplot(aes(fill=Pclass))\nfull %>% ggplot(aes(x=Sex,y=Age)) + geom_boxplot(aes(fill=Sex))","metadata":{"execution":{"iopub.status.busy":"2022-01-21T13:15:22.33771Z","iopub.execute_input":"2022-01-21T13:15:22.339548Z","iopub.status.idle":"2022-01-21T13:15:23.202395Z"},"trusted":true},"execution_count":8,"outputs":[{"name":"stderr","text":"Warning message:\n“Removed 263 rows containing non-finite values (stat_boxplot).”\nWarning message:\n“Removed 263 rows containing non-finite values (stat_boxplot).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXwU9d3A8dndXIQrAeSSQ8UooIjgfaKt2tOjntSb2nrf9433U7Ue9bZa69NH\nK16tR70qKiJV611RUVEREEMRwp2DJLvPH7FINQkhhZ3NL+/3yxev3ZndzZdX1uTDzM5MIpPJ\nRAAAtH3JuAcAAGD1EHYAAIEQdgAAgRB2AACBEHYAAIEQdgAAgRB2AACBEHYAAIHIi3uAlspk\nMgsWLIh7ivara9euURRVVlbW1tbGPQvtTiqV6tSpUxRFixcvTqfTcY9Du1NYWFhUVJTJZBYt\nWhT3LO1aaWlp3CO0AW0p7Orr6+Oeov1KJpOR7wIxSSQSDe/AdDrtHUj2ZTKZZDLp7UebYFcs\nAEAghB0AQCCEHQBAIIQdAEAghB0AQCCEHQBAIIQdAEAghB0AQCCEHQBAIIQdAEAghB0AQCCE\nHQBAIIQdAEAghB0AQCCEHQBAIIQdAEAghB0AQCCEHQBAIIQdAEAghB0AQCCEHQBAIIQdAEAg\nhB0AQCCEHQBAIIQdAEAghB0AQCCEHQBAIIQdAEAg8rLzZT