l$Pclass == 2] <- p2MedAge\nfull$Age[is.na(full$Age) & full$Pclass == 3] <- p3MedAge\n\n#Checking for missing age data\nany(is.na(full$Age))","metadata":{"execution":{"iopub.status.busy":"2022-01-21T13:15:23.261574Z","iopub.execute_input":"2022-01-21T13:15:23.263637Z","iopub.status.idle":"2022-01-21T13:15:23.295407Z"},"trusted":true},"execution_count":10,"outputs":[{"output_type":"display_data","data":{"text/html":"FALSE","text/markdown":"FALSE","text/latex":"FALSE","text/plain":"[1] FALSE"},"metadata":{}}]},{"cell_type":"markdown","source":"### 3.2.3 Fare\nThere is only 1 missing fare in our test data, let's look at its characteristics.","metadata":{}},{"cell_type":"code","source":"full[is.na(full$Fare),]","metadata":{"execution":{"iopub.status.busy":"2022-01-21T13:15:23.311021Z","iopub.execute_input":"2022-01-21T13:15:23.313014Z","iopub.status.idle":"2022-01-21T13:15:23.344449Z"},"trusted":true},"execution_count":11,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 1 × 12</caption>\n<thead>\n\t<tr><th></th><th scope=col>Survived</th><th scope=col>Pclass</th><th scope=col>Name</th><th scope=col>Sex</th><th scope=col>Age</th><th scope=col>SibSp</th><th scope=col>Parch</th><th scope=col>Fare</th><th scope=col>Embarked</th><th scope=col>set</th><th scope=col>Dependents</th><th scope=col>Sex.factor</th></tr>\n\t<tr><th></th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>1044</th><td>NA</td><td>3</td><td>Storey, Mr. Thomas</td><td>male</td><td>60.5</td><td>0</td><td>0</td><td>NA</td><td>S</td><td>test</td><td>0</td><td>2</td></tr>\n</tbody>\n</table>\n","