ents: Factor w/ 9 levels \"0\",\"1\",\"2\",\"3\",..: 2 2 1 2 1 1 1 5 3 2 ...\n","output_type":"stream"}]},{"cell_type":"markdown","source":"## 4.1 Train and test data split\nFirst, we will split the real training and testing data sets. Then, we will split the training set into another training and testing data set for Cross Validation.","metadata":{}},{"cell_type":"code","source":"train <- full %>% filter(set == \"train\") %>% select(-set)\ntest <- full %>% filter (set == \"test\") %>% select(-set)\n\n#Creating data partition to cross validation\nind = createDataPartition(train$Survived,times = 1,p = 0.8,list = FALSE)\ntrain_val <- train[ind,]\ntest_val <- train[-ind,]\n\n#Checking distribution of data partition\nround(prop.table(table(train$Survived)*100),digits=3)\nround(prop.table(table(train_val$Survived)*100),digits=3)\nround(prop.table(table(test_val$Survived)*100),digits=3)","metadata":{"execution":{"iopub.status.busy":"2022-01-21T13:15:23.461349Z","iopub.execute_input":"2022-01-21T13:15:23.463231Z","iopub.status.idle":"2022-01-21T13:15:23.53104Z"},"trusted":true},"execution_count":15,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n    0     1 \n0.616 0.384 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n    0     1 \n0.616 0.384 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\n    0     1 \n0.616 0.384 "},"metadata":{}}]},{"cell_type":"markdown","source":"## 4.2 Logistic Regression Model\nFirst, let's test it out on our validation sets.","metadata":{}},{"cell_type":"code","source":"log.model <- glm(formula = Survived ~ ., data = train_val, family = binomial(link='logit'))\nsummary(log.model)","metadata":{"execution":{"iopub.status.busy":"2022-01-21T13:15:23.534268Z","iopub.execute_input":"2022-01-21T13:15:23.536431Z","iopub.status.idle":"2022-01-21T13:15:23.621679Z"},"trusted":true},"execution_count":16,"outputs":[{"output_type":"display_data","data":{"text/plain":"\nCall:\nglm(formula = Survive